import React, { useState } from 'react';
import { FaBuilding, FaUserTie, FaBriefcase, FaChartLine } from 'react-icons/fa';

function PlacementHistory() {
    // Example placement data (Mock data)
    const [placements] = useState([
        { id: 1, company: 'Google' },
        { id: 2, company: 'Microsoft' },
        { id: 3, company: 'Amazon' },
        { id: 4, company: 'Facebook' },
        { id: 5, company: 'Tesla' },
        { id: 6, company: 'IBM' },
        { id: 7, company: 'Adobe' },
        { id: 8, company: 'Apple' },
        { id: 9, company: 'Netflix' },
    ]);

    return (
        <div style={styles.container}>
            {/* Page Title and Summary */}
            <div style={styles.header}>
                <h1 style={styles.title}>
                    <FaChartLine style={{ marginRight: '10px' }} /> Placement History
                </h1>
                <p style={styles.summary}>
                    Explore the leading companies where our talented students have been placed.
                </p>
            </div>

            {/* Placement Summary Section */}
            <div style={styles.cardContainer}>
                <div style={styles.card}>
                    <FaBuilding style={styles.icon} />
                    <h3>Total Companies</h3>
                    <p>{placements.length}</p>
                </div>
                <div style={styles.card}>
                    <FaUserTie style={styles.icon} />
                    <h3>Top Company</h3>
                    <p>Google</p>
                </div>
                <div style={styles.card}>
                    <FaBriefcase style={styles.icon} />
                    <h3>Most Hired Role</h3>
                    <p>Software Engineer</p>
                </div>
            </div>

            {/* Placement Table */}
            <table style={styles.table}>
                <thead>
                    <tr style={styles.tableHeader}>
                        <th style={styles.th}>ID</th>
                        <th style={styles.th}>Company</th>
                    </tr>
                </thead>
                <tbody>
                    {placements.map((placement) => (
                        <tr key={placement.id} style={styles.tableRow}>
                            <td style={styles.td}>{placement.id}</td>
                            <td style={styles.td}>{placement.company}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

const styles = {
    container: {
        padding: '20px',
        fontFamily: 'Arial, sans-serif',
        backgroundColor: '#f8f9fa',
        minHeight: '100vh',
    },
    header: {
        textAlign: 'center',
        marginBottom: '30px',
    },
    title: {
        fontSize: '28px',
        marginBottom: '10px',
        color: '#343a40',
    },
    summary: {
        fontSize: '16px',
        color: '#6c757d',
    },
    cardContainer: {
        display: 'flex',
        justifyContent: 'center',
        gap: '20px',
        marginBottom: '30px',
    },
    card: {
        backgroundColor: '#fff',
        boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
        borderRadius: '8px',
        padding: '20px',
        textAlign: 'center',
        width: '200px',
        transition: 'transform 0.2s',
        cursor: 'pointer',
    },
    cardHover: {
        transform: 'scale(1.05)',
    },
    icon: {
        fontSize: '30px',
        color: '#007BFF',
        marginBottom: '10px',
    },
    table: {
        width: '80%',
        margin: '0 auto',
        borderCollapse: 'collapse',
        backgroundColor: '#fff',
        boxShadow: '0 2px 6px rgba(0, 0, 0, 0.2)',
        borderRadius: '8px',
        overflow: 'hidden',
    },
    tableHeader: {
        backgroundColor: '#007BFF',
        color: '#fff',
    },
    th: {
        padding: '15px',
        fontSize: '16px',
    },
    tableRow: {
        transition: 'background-color 0.2s, transform 0.2s',
    },
    tableRowHover: {
        backgroundColor: '#e9ecef',
        transform: 'scale(1.01)',
    },
    td: {
        padding: '15px',
        textAlign: 'center',
        fontSize: '14px',
        borderBottom: '1px solid #ddd',
    },
};

export default PlacementHistory;
